import React from "react";
import Countdown from "react-countdown";

const Countdownn = () => {
  const data = {
    days: "01",
    hours: "00",
    minutes: "00",
    seconds: "00",
  };
  return (
    <>
      {/* <Countdown date={Date.now() + 10000000} /> */}
      <Countdown date={Date.now()} />
    </>
  );
};

export default Countdownn;
